import './navbar.css'

function Navbar()
{
    return(
        <>
            <nav>
                <ul className="navbar-left">
                    <li><a href='#'>Portfolio</a></li>
                    <li><a href='#'>Resume</a></li>
                    <li><a href='#'>Contact</a></li>  
                </ul>
                <ul className="navbar-right">
                    <li></li>
                </ul>
            </nav>
        </>
    )
}

export default Navbar;
